import './App.css';
import Navbar from './components/Navbar';
import { Route, Routes } from "react-router-dom";


function App() {
  return (
    <>
    <Navbar/>
    <Routes>
    <Route path="/library" element={<Library />} />
    <Route path="/trade" element={<Trade />} />
    <Route path="/trade" element={<Trade />} />
    <Route path="/trade" element={<Trade />} />
  </Routes> 
  </>
  );
}

export default App;
